// API Routes
app.get('/professional', async (req, res) => {
  try {
    console.log('API: Fetching professional data...');
    const professionalData = await Professional.findOne();
    
    if (!professionalData) {
      return res.status(404).json({ error: 'Professional data not found' });
    }
    
    console.log('API: Data found, sending response');
    res.json(professionalData);
  } catch (error) {
    console.error('API Error:', error);
    res.status(500).json({ error: 'Internal server error' });
  }
});

// Health check
app.get('/api/health', (req, res) => {
  res.json({ 
    status: 'Server is running!',
    timestamp: new Date().toISOString(),
    database: mongoose.connection.readyState === 1 ? 'Connected' : 'Disconnected'
  });
});

// Basic route
app.get('/', (req, res) => {
  res.send("Kolawole Uthman Professional API is running! Visit /professional for data.");
});

app.listen(PORT, () => {
  console.log(` Server running at http://localhost:${PORT}`);
  console.log(` API: http://localhost:${PORT}/professional`);
  console.log(` Serving: Kolawole Uthman - Developer`);
});